import Vue from 'vue'
import App from './App.vue'
import VeeValidate from 'vee-validate';
import {Tabs, Tab} from 'vue-tabs-component';

Vue.use(VeeValidate);
Vue.component('tabs', Tabs);
Vue.component('tab', Tab);
Vue.config.productionTip = false

new Vue({
  render: h => h(App),
}).$mount('#app')
